use strict;

use strict;
use warnings;
use Data::Dumper;
use Getopt::Long;   
use List::Util qw/max all/;
use List::MoreUtils qw/mesh/;

$| = 1;

my $SAM;
my $readsFasta;

GetOptions (
	'SAM:s' => \$SAM, 
	'readsFasta:s' => \$readsFasta, 
);

unless($SAM)
{
	die "Please specify --SAM";
}

unless($readsFasta)
{
	die "Please specify --readsFasta";
}

die "File $SAM not existing" unless(-e $SAM);

print "Reading $readsFasta\n";

my $reads_href = readFASTA($readsFasta);

open(SAM, '<', $SAM) or die "Cannot open $SAM";
while(<SAM>)
{
	chomp;
	next unless($_);
	next if(substr($_, 0, 1) eq '@');

	my @line_fields = split(/\t/, $_);
	die unless(scalar(@line_fields) >= 11); 
	my $Name = $line_fields[0];
	my $FLAG = $line_fields[1];
	my $rName = $line_fields[2];
	my $POS = $line_fields[3];
	my $mapQ = $line_fields[4];
	my $CIGAR = $line_fields[5];
	my $SEQ = $line_fields[9];
	my $QUAL = $line_fields[10];
	
	die "Read $Name not in reads FASTA $readsFasta" unless(exists $reads_href->{$Name});
	
	my $SEQ_rc = reverseComplement($SEQ);

	my $alignment_RC = isReverseComplemented($FLAG);
	my $isIn_SEQ = (index(uc($reads_href->{$Name}), uc($SEQ)) != -1);
	my $isIn_SEQ_rc = (index(uc($reads_href->{$Name}), uc($SEQ_rc)) != -1);

	# print substr($reads_href->{$Name}, 6213457 - 1, 6310058 - 6213457 + 1), "\n";
	# print reverseComplement(substr($reads_href->{$Name}, 6213457 - 1, 6310058 - 6213457 + 1)), "\n";
	# exit;
	
	
	# my $isIn_SEQ_rc_2 = (index(uc($reads_href->{$Name}), reverseComplement(uc(''))) != -1);
	# die $isIn_SEQ_rc_2;

	# die (substr($reads_href->{$Name}, 6213457 - 1, 6310058 - 6213457 + 1));
	# die reverseComplement(substr($reads_href->{$Name}, 6213457 - 1, 6310058 - 6213457 + 1));
	# die (reverseComplement(uc(substr($reads_href->{$Name}, 6213457 - 1, 6310058 - 6213457 + 1))) eq uc('')) ? 1 : 0;
	
	if($SEQ eq '*')
	{
		print "\t* ";	
	}
	else
	{
		if($alignment_RC)
		{
			if(not $isIn_SEQ_rc)
			{
				print "\t! $CIGAR ";
			} 
		}
		else
		{
			if(not $isIn_SEQ)
			{
				print "\t! ";			
			}
		}
	}
	print join("\t", $Name, $POS, length($SEQ), ($alignment_RC ? 'al-' : 'al+'), ((index(uc($SEQ), 'N') != -1) ? 'N' : ''), ($isIn_SEQ ? 1 : 0), ($isIn_SEQ_rc ? 1 : 0)), "\n";
	
	if((not $isIn_SEQ) and (not $isIn_SEQ_rc))
	{
		#print "\tWARNING!";
		#print "\t$CIGAR\n";
		#print "\t$SEQ\n";
		
	}
	
}
close(SAM);

sub isReverseComplemented
{
	my $FLAG = shift;
	die unless(defined $FLAG);
	return ($FLAG & 16);
}

sub readFASTA
{
	my $file = shift;	
	my $cut_sequence_ID_after_whitespace = shift;
	
	my %R;
	
	open(F, '<', $file) or die "Cannot open $file";
	my $currentSequence;
	while(<F>)
	{		
		my $line = $_;
		chomp($line);
		$line =~ s/[\n\r]//g;
		if(substr($line, 0, 1) eq '>')
		{
			if($cut_sequence_ID_after_whitespace)
			{
				$line =~ s/\s+.+//;
			}
			$currentSequence = substr($line, 1);
			$R{$currentSequence} = '';
		}
		else
		{
			die "Weird input in $file" unless (defined $currentSequence);
			$R{$currentSequence} .= uc($line);
		}
	}	
	close(F);
		
	return \%R;
}


sub reverseComplement
{
	my $kMer = shift;
	$kMer =~ tr/ACGTacgt/TGCAtgca/;
	return scalar(reverse($kMer));
	return $kMer;
}
